import{_ as t,c as o,o as r,ah as i}from"./chunks/framework.PvdZnrZd.js";const u=JSON.parse('{"title":"AIR SPEED SHIPPING","description":"AIR SPEED SHIPPING","frontmatter":{"title":"AIR SPEED SHIPPING","description":"AIR SPEED SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/air-speed-shipping.md","filePath":"zenith/featured-app/shipping/air-speed-shipping.md"}'),n={name:"zenith/featured-app/shipping/air-speed-shipping.md"};function l(p,e,a,s,h,d){return r(),o("div",null,[...e[0]||(e[0]=[i('<p>With <strong><a href="https://webkul.com/blog/shopify-multivendor-marketplace-new-theme-launched/" target="_blank" rel="noreferrer">Multivendor Marketplace</a></strong> App, You might have used <a href="https://webkul.com/blog/shopify-multivendor-marketplace-usps-shipping-new-theme/" target="_blank" rel="noreferrer">USPS</a>, <a href="https://webkul.com/blog/shopify-multivendor-canada-post-new-theme/" target="_blank" rel="noreferrer">Canada Post</a> or <a href="https://webkul.com/blog/shopify-multivendor-ecom-express-shipping/" target="_blank" rel="noreferrer">Ecom Express Shipping</a> Feature Apps on your marketplace to manage fulfillment and generate shipping labels.</p><p>Now, We came up with a new feature app named &quot;AirSpeed Shipping&quot; to manage fulfillment on a priority basis.</p><p>This feature app comes with an option to <strong>Notify the Courier</strong> about the prepared order to be shipped to the customers.</p><p>Using this feature app, both admin and sellers can notify the courier about the customer&#39;s order from their respective panels.</p><p>Accordingly, sellers will manage the fulfillment from their seller panels and generate shipping labels for the fulfilled orders.</p><p>This feature App comes with a charge of $10 USD/month over and above your current multivendor plan.</p><p>THE AIRSPEED SHIPPING FEATURE APP IS AVAILABLE <strong>ONLY FOR FULFILLMENT</strong>.</p><h3 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;">​</a></h3><ul><li>Both admin and seller can notify the courier about the prepared orders.</li><li>Once you get notified, the seller can start the order fulfillment from his/her end.</li><li>AirSpeed Shipping has the highest fulfillment priority among all the other Shipping methods.</li><li>No need to enter the Tracking Number &amp; Shipping method while fulfilling any order as they get fetched automatically based on configured AirSpeed Shipping details.</li><li>Also, Sellers can generate &amp; print the shipping label for fulfilled orders from their respective panels.</li></ul><h3 id="how-to-enable-the-airspeed-shipping-feature" tabindex="-1">How to Enable the AirSpeed Shipping Feature? <a class="header-anchor" href="#how-to-enable-the-airspeed-shipping-feature" aria-label="Permalink to &quot;How to Enable the AirSpeed Shipping Feature?&quot;">​</a></h3><p>To get this feature app installed on your marketplace, admin needs to follow below-given steps:</p><ul><li>Go to <strong>Feature Apps</strong> section in the admin panel of the Multivendor App.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/featuredapps.webp" alt="AirSpeed2"></p><ul><li>Search for the <strong>AirSpeed Shipping</strong> Feature App and Click on <strong>Enable</strong> button.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/airspeed.webp" alt="AirSpeed1"></p><ul><li>Further, click on <strong>Agree</strong> button if you agree with the feature app charge.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/agreeairspeed.webp" alt="AirSpeed3"></p><ul><li>Redirecting to Shopify backend, click on <strong>Approve Charge</strong> button to approve the additional charge.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Screenshot-11.png" alt="AirSpeed4"></p><p>This way, admin can enable the AirSpeed Shipping feature.</p><h3 id="workflow-at-admin-end" tabindex="-1">Workflow at Admin End <a class="header-anchor" href="#workflow-at-admin-end" aria-label="Permalink to &quot;Workflow at Admin End&quot;">​</a></h3><h3 id="airspeed-shipping-configuration" tabindex="-1">AirSpeed Shipping Configuration <a class="header-anchor" href="#airspeed-shipping-configuration" aria-label="Permalink to &quot;AirSpeed Shipping Configuration&quot;">​</a></h3><p>As soon as the AirSpeed Shipping feature app is enabled in the app, a new sub-menu gets added in the Configuration menu of the app i.e <strong>Air Speed Shipping Configuration</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/asdashconfig.webp" alt="AirSpeed5"></p><p>Visiting this section, the admin needs to configure the details related to AirSpeed Shipping such as AirSpeed Client ID, Token ID, and Waybill Prefix.</p><p>To get these details, the admin needs to register to AirSpeed Shipping Courier and for AirSpeed Waybill Prefix, You need to contact AirSpeed courier.</p><p>Moreover, to test the functionality of this shipping, admin can enable the Sandbox mode.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/asconfiguration.webp" alt="airspeed shipping6"></p><p><strong>Please Note:- It is mandatory to have Customer&#39;s Contact Number at Checkout.</strong></p><p>As the AirSpeed Shipping feature is configured from admin end, he/she will get the option to notify courier about customer&#39;s orders.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/supriya4-Checkout-Shopify.png" alt="Checkout Form1"></p><p>(Go to <strong>Shopify Backend</strong>&gt;&gt;<strong>Settings</strong>&gt;&gt;<strong>Checkout</strong>&gt;&gt;Go to <strong>Form Options</strong>&gt;&gt;Make the &quot;Shipping Address Phone Number&quot; <strong>Required</strong>&gt;&gt;Save.)</p><h3 id="orders-admin-end" tabindex="-1">Orders: Admin End <a class="header-anchor" href="#orders-admin-end" aria-label="Permalink to &quot;Orders: Admin End&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderlisting.webp" alt="Order details"></p><p>Also, visiting the <strong>Orders</strong> section of the admin panel, You will get a <strong>Notify Courier</strong> button to send the notification to the courier to pick up the prepared order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/notifyorder.webp" alt="Order Details1"></p><p>Go to <strong>Orders</strong>&gt;&gt;Visit <strong>Order Listing</strong> section&gt;Select the <strong>Order</strong> from the listing&gt;&gt;Click on <strong>View</strong> button in the <strong>Action</strong> menu&gt;&gt;Click on <strong>Notify Courier</strong> button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/notifyorderconfirm.webp" alt="AirSpeed8"></p><p>Furthermore, once the admin notifies the courier about the order to be picked up, the same will be updated on seller side too.</p><p>Now, if the admin doesn&#39;t notify the courier from his panel, the seller will get the <strong>Notify Courier</strong> button on his/her seller panel.</p><h3 id="fulfillment-by-the-seller" tabindex="-1">Fulfillment by the Seller <a class="header-anchor" href="#fulfillment-by-the-seller" aria-label="Permalink to &quot;Fulfillment by the Seller&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/vieworder.webp" alt="Seller Order1"></p><p>Moreover, once the admin configure the AirSpeed Shipping from his/her end. Seller will also get an option to notify the courier if the customer&#39;s order is prepared to be picked up.</p><p>So, from the Order details section, the seller can send the notification to the courier. Once the order is picked up, the seller will fulfill it from his end.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/notifyorderseller.webp" alt="Seller End "></p><p>If the admin has already notified the Courier, the seller will get the option to fulfill the order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderfullpage.webp" alt="Fulfill order"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-2-1.png" alt="Fulfill Items"></p><p>Now, Clicking on the Fulfill button, the seller will get the Air-Speed Shipping as one of the fulfillment methods. The Tracking number and the shipping method appears automatically for that order.</p><p>Thus, the seller will click on <strong>Fulfill</strong> <strong>Items</strong> button to fulfill the order.</p><p>Also, once the seller will fulfill the items, he/she will get an option to generate a shipping label for that order.</p><h3 id="how-to-generate-shipping-label" tabindex="-1">How to Generate Shipping Label? <a class="header-anchor" href="#how-to-generate-shipping-label" aria-label="Permalink to &quot;How to Generate Shipping Label?&quot;">​</a></h3><p>Seller will get an option to generate Shipping Label for fulfilled orders in the Order detail section of the app.</p><p>The seller needs to follow the below steps to generate the shipping label for fulfilled orders:</p><ul><li>Login to Seller Panel.</li><li>Go to Orders.</li><li>Select the fulfilled order from the order listing page.</li><li>Further, click on the View button in the Action menu.</li><li>Click on the Generate Shipping Label button shown on the Order detail page.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="Shipping Label"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Shipping-Label-794250.png" alt="Shipping Label1"></p><p>Shipping Label Generated.</p><p>This way, Seller will generate the shipping label using AirSpeed Shipping Feature.</p><p>This is all about the AirSpeed Shipping Feature App.</p><h2 id="demo" tabindex="-1">Demo <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;Demo&quot;">​</a></h2><p>Further, check out the demo</p><p><a href="https://multivendor-marketplace-5.myshopify.com/pages/seller-profile" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com/pages/seller-profile</a></p>',63)])])}const c=t(n,[["render",l]]);export{u as __pageData,c as default};
